import React from 'react';
import classes from './PageBar.module.css';
const PageBar =(props)=>{
    return(
        <div className = {classes.PageBar}>
            <h3>Teevriin heregsel daatgal !</h3>
            <div>
                
                <button><i class="mdi mdi-autorenew"></i></button>
            </div>
            
        </div>
    );
}
export default PageBar;
